import React, { Component } from "react";
import ListOfPlants from "../../components/ListOfPlants/ListOfPlants";
import StatusBar from "../../components/StatusBar/StatusBar";
// import axios from "axios";

export default class Home extends Component {
  state = {
    plantInfo: [],
  };
  componentDidMount() {
    this.setState({
      plantInfo: [
        { timestamp: 1618274087486, plantName: "Name1" },
        { timestamp: 1618274087486, plantName: "Name2" },
        { timestamp: 1618252487486, plantName: "Name3" },
        { timestamp: 1618274087486, plantName: "Name4" },
        { timestamp: 1618274087486, plantName: "Name5" },
      ],
    });
    // axios
    //   .get("https://localhost:5001/api/SVPlants")
    //   .then((res) =>
    //     this.setState({
    //       plantInfo: res.data,
    //     })
    //   )
    //   .catch((err) => console.error(err));
  }
  buttonClicks = (time) => {
    const time_subtraction = Date.now() - time;
    if (time_subtraction < 30000) {
      this.setState({
        timestamp: Date.now(),
      });
      return "Watering";
    } else if (1 === 2) {
      return "Must Water";
    } else {
      return "Water";
    }
  };

  render() {
    return (
      <div>
        <StatusBar />
        <div style={{ display: "flex", justifyContent: "space-evenly" }}>
          {this.state.plantInfo.map((plant) => (
            <ListOfPlants buttonClicks={this.buttonClicks} plant={plant} />
          ))}
        </div>
      </div>
    );
  }
}
